import React from 'react';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import './Home.css'

const Home = () => {
  let mode = "undefined";
    // const select_normal = React.useCallback(() => {
    //     console.log("posting");
    //     //set mode variable
    //   });
    // function selectNormal(props){
    //     mode = "normal"
    // }
    // function selectGod(props){
    //     mode = "god"
    // }


      const select_god = React.useCallback(() => {
        console.log("posting");
        let mode = 'god';
        const url = 'http://localhost:8000/mode';
        const formData = new FormData();
        formData.append('mode', mode);

        fetch(url, { //change!!
          method: 'POST',
          body: mode,
        })
          .then((response) => response.json())
          .then((data) => console.log(data))
          .catch((error) => console.error(error));
      });

    return (
      <div className="mode_selection">
        <Link to="/Title">
          <Button onClick={select_god} className="Title">
            Normal
          </Button>
        </Link>
  
        <Link to="/Title">
          <Button onClick={select_god} className="Title">
            GodMode
          </Button>
        </Link>
      </div>
    );
  }

  export default Home
